$(init);

function init(){
  var app = {};

  initCore();
  initTopMenu();
  initSidebar();

  function initCore(){
    app = new App.GardenDesigner();
    app.init();

    console.log('Core initialize complete')
  }

  function initTopMenu(){
    // $('.tooltip').tooltipster(); // Всплывающие подсказки у элементов верхнего меню

    // Кнопки верхнего меню
    $('#deleteObject').on('click', function(){ app.deleteObject(); })
    // $('#changeObjectTexture').on('click', function(){ app.changeObjectTexture(); })
    $('#rotateObjectLeft').on('click', function(){ app.rotateObject(-45); })
    $('#rotateObjectRight').on('click', function(){ app.rotateObject(45); })
    $('#moveUpObject').on('click', function(){ app.moveObjectUp(); })
    $('#moveDownObject').on('click', function(){ app.moveObjectDown(); })
    
    $('#saveImage').on('click', function(event){ 
      var $progress = $('#progressDialog');
      // var cond = $progress.css('opacity') == 0 ? 1 : 0;
      var cond  = $progress.css('height') == '0px' ? '30px' : '0px';
      $progress.css({height: cond});      

      app.saveImage(); 
    });
    
    initTextureList();

    console.log('Top menu initialize complete');
  }

  function initTextureList(){
    var $textureList = $('#texture-list'); // Диалог изменения текстуры
    var $changeTexture = $('#changeObjectTexture'); // Кнопка вызова диалога изменения текстуры
    var show = true; // Флаг отображения диалога 

    $changeTexture.on('click', function(e){
      var pos = $(this).offset();
      var left = pos.left;
      var top = pos.top + $('#menu-container').height() + 2;
      var cond = $textureList.css('height') == '0px' ? '260px' : '0px';
      $textureList.css({ left: left + 'px', top: top + 'px', height: cond })
    })

    var $textureIcons = $textureList.find('div');
    $textureIcons.on('click', function(){
      // Получение относительного пути к иконке текстуры
      var src = $(this).context.attributes[0].nodeValue;
        // Создание пути к текстуре
      var s = src.split('-')[1].split('icon');
      var path = './images/textures/';
      var name = s[0] + s[1];
      var textureSrc = path + name + '.jpg';

      app.changeObjectTexture(textureSrc);

      $textureList.css('height', 0);
      show = true;
    });
  }

  function initSidebar(){
    // Получение всех объектов из боковой панели
    var $elems = $('.nav-panel').find('.object');

    $elems.draggable({
      cursorAt: [0, 0],
      helper: 'clone',
      scroll: false,
      // helper: function(){ return $(this).clone() },
      start: function(event, ui){
        var obj = imagesSize[ui.helper.context.id];
        ui.helper
          .removeClass('ui-draggable ui-draggable-dragging')
          .addClass('dragObject')
          .css({
            'position': 'relative', 
            // 'background-size': $(this).css('background-size'),
            'background-image': $(this).css('background-image'),
            'background-repeat': $(this).css('background-repeat'),
            'background-position': $(this).css('background-position'),
            // 'background-color': 'rgba(44, 62, 80, 0.7)',
            'width': obj.width + 'px',
            'height': obj.height + 'px',
            'margin-top': ui.offset.top - ui.position.top - 60,
            'margin-left': ui.offset.left - ui.position.left,
          })
          .appendTo('body');
        $('canvas').css({'opacity': 0.5});
      },  
      
      stop: function(event, ui){
        $('canvas').css({'opacity': 1});
        // Получение ID текущего перестаскиваемого объекта
        var objectId = $(this).get(0).id;
        app.createObject(objectId);
      },

    });


    console.log('Sidebar initialize complete')
  }
}
var App = {};
var imagesSize = {};

App.GardenDesigner = function(){
  var images = {};
  
  this.loadImages = function(){
    var sources = {
      tree:           'images/tree.png',
      fruitTree:      'images/fruitTree.png',
      floweringTree:  'images/floweringTree.png',
      house1:         'images/housePlan01.png',
      house2:         'images/housePlan02.png',
      house3:         'images/housePlan03.png',
      pool:           'images/pool.png',
      car1:           'images/car1.png',
      car2:           'images/car2.png',
      car3:           'images/car3.png',
      car4:           'images/car4.png',
      gardenTable:    'images/gardenTable.png',
      gardenBench:    'images/bench.png',
      gardenPlot:     'images/textures/grass01.jpg',
      flower1:        'images/flower1.png',
      shrub1:         'images/shrub1.png',
      shrub2:         'images/shrub2.png'
    }

    var i = 0;
    for (var src in sources){
      images[src] = new Image();
      images[src].onload = function(name){
        return function(){
          imagesSize[name] = {
            width: this.width,
            height: this.height
          }
        }
      }(src)
      images[src].src = sources[src];
    }

    return images;
  }


  var selectedShapes = [];

  this.getSelectedShapes = function(){ 
    return selectedShapes; 
  }
  this.setSelectedShapes = function(shapes){ 
    selectedShapes = shapes; 
  }
  
  var stage, layer, objects;

  // Инициализация рабочей области приложения 
  this.init = function(){
    this.loadImages();

    stage = new Kinetic.Stage({
      width: 1500,
      height: 1500,
      container: 'container',
    });

    layer = new Kinetic.Layer();

    var background = new Kinetic.Rect({
      width: stage.getWidth(),
      height: stage.getHeight(),
      name: 'background',
    });

    layer.add(background);
    stage.add(layer);

    // Список доступных объектов
    objects = this.getAllObjects();

    // Отключение сглаживания изображений
    var disableImageSmoothing = function() {
      var ctx = $("canvas")[0].getContext('2d');
      ctx.imageSmoothingEnabled = false;
      ctx.mozImageSmoothingEnabled = false;
    }();
  }

  this.getAllObjects = function(){
    // Сохранить текущий контекст ( контекст всего приложения)
    var _this = this;
    return {
      house1:         function(position){ return _this.createHouse(position, images.house1); },
      house2:         function(position){ return _this.createHouse(position, images.house2); },
      house3:         function(position){ return _this.createHouse(position, images.house3); },
      pool:           function(position){ return _this.createPool(position); },
      tree:           function(position){ return _this.createTree(position, images.tree); },
      fruitTree:      function(position){ return _this.createTree(position, images.fruitTree); },
      floweringTree:  function(position){ return _this.createTree(position, images.floweringTree); },
      car1:           function(position){ return _this.createCar(position, images.car1); },
      car2:           function(position){ return _this.createCar(position, images.car2); },
      car3:           function(position){ return _this.createCar(position, images.car3); },
      car4:           function(position){ return _this.createCar(position, images.car4); },
      gardenTable:    function(position){ return _this.createGardenTable(position); },
      gardenBench:    function(position){ return _this.createGardenBench(position); },
      flower1:        function(position){ return _this.createPlant(position, images.flower1, 60); },
      shrub1:         function(position){ return _this.createPlant(position, images.shrub1, 70); }, // shrub - куст
      shrub2:         function(position){ return _this.createPlant(position, images.shrub2, 70); },
      gardenPlot:     function(position){ return _this.createGardenPlot(position); },
    }
  }

  this.render = function(){
    layer.draw();
  }

  this.createObject = function(objectId, pos, renderAll){
    var cursorPos = stage.getPointerPosition() || pos; // Получение текущей позиции курсора мыши
    if( !cursorPos ){ return };
    cursorPos = this.roundingCoordinates(cursorPos);
 
    var object = objects[objectId](cursorPos);
    var size = { 
      width: object.getWidth(), 
      height: object.getHeight() 
    };
    var offset = {
      x: size.width / 2, 
      y: size.height / 2
    };
    object.setAttrs({ offset: offset });

    var group = this.addBound_(object, size, offset);

    // console.log(objectId.charAt(0).toUpperCase() + objectId.slice(1) + ' added to workspace');

    layer.add(group);

    if ( renderAll ) return group; 

    this.render(); 
  }
  
  var gridSize = 10;
  this.roundingCoordinates = function(pos){
    var onesX = pos.x % gridSize;
    var onesY = pos.y % gridSize;

    return {
      x: (onesX < gridSize/2) ? (pos.x - onesX) : (pos.x + gridSize - onesX),
      y: (onesY < gridSize/2) ? (pos.y - onesY) : (pos.y + gridSize - onesY)
    };
  }

  this.addBound_ = function (object, size, offset){
    var _this = this;
    var boundGroup = new Kinetic.Group({
      draggable: true,
      dragDistance: 3,
      dragBoundFunc: function(pos) {
        var newPos = _this.roundingCoordinates(pos);
        return {
          x: newPos.x,
          y: newPos.y
        }
      }
    });

    var boundRect = new Kinetic.Rect({
      width: size.width,
      height: size.height,
      fill: 'rgba(52, 152, 219, 0.4)',
      stroke: 'rgb(52, 73, 94)',
      strokeWidth: 1,
      strokeScaleEnabled: false,
      name: 'bound',
      offset: offset
    });

    boundGroup.add(object).add(boundRect);

    if ( object.getAttr('name') == 'gardenPlot'){
      var x = object.getPosition().x - size.width / 2;
      var y = object.getPosition().y - size.height / 2;
      var options = [
        {x: x, y: y, name: 'topLeft'},
        {x: x + size.width, y: y, name: 'topRight'},
        {x: x, y: y + size.height, name: 'bottomLeft'},
        {x: x + size.width, y: y + size.height, name: 'bottomRight'}
      ];

      this.addAnchors(boundGroup, options);
    }

    var bound = boundGroup.children[1];
    bound.hide();

    var selected = false; // Флаг выделения объекта
    var o = {};
    boundGroup.on('click', function(evt){
      o = boundGroup.children[0];
      if ( selected == true){
        bound.hide();
        selectedShapes.splice(selectedShapes.indexOf(this), 1);
        if (o.name() == 'gardenPlot'){ 
          _this.hideAnchors(boundGroup); 
        }
      }
      else {
        bound.x(o.x()); 
        bound.y(o.y());
        bound.show();
        selectedShapes.push(this);
        if (o.name() == 'gardenPlot'){
          _this.showAnchors(boundGroup); 
        }
      }
      selected = !selected; // Инвертировать значение флага

      layer.draw();
    })

    return boundGroup;
  }


  this.getAnchors = function(object){
    return {
      topLeft: object.find('.topLeft')[0],
      topRight: object.find('.topRight')[0] ,
      bottomLeft: object.find('.bottomLeft')[0],
      bottomRight: object.find('.bottomRight')[0],
    }
  }

  this.hideAnchors = function(object){
    var anchors = this.getAnchors(object);
    for (var a in anchors){
      anchors[a].hide();
    }
  }

  this.showAnchors = function(object){
    var anchors = this.getAnchors(object);
    for (var a in anchors){
      anchors[a].show();
    }
  }


  this.createBaseObject = function(position, texture, name, size){
    var size = size || { width: texture.width + .5, height: texture.height + .5};
    return new Kinetic.Rect({
      width: size.width,
      height: size.height,
      fillPatternImage: texture,
      x: position.x + .5 + size.width/2,
      y: position.y + .5 + size.height/2,
      name: name
    })
  }

  this.createHouse = function (position, texture){
    return this.createBaseObject(position, texture, 'house');
  }

  this.createTree = function (position, texture){
    return this.createBaseObject(position, texture, 'tree');
  }

  this.createPlant = function(position, texture){
    return this.createBaseObject(position, texture);
  }

  this.createPool = function (position){
    // var position = { x: position.x + 0.5, y: position.y + 0.5 };
    return this.createBaseObject(position, images.pool);
  }

  this.createCar = function (position, texture){
    return this.createBaseObject(position, texture);
  }

  this.createGardenBench = function (position){
    return this.createBaseObject(position, images.gardenBench);
  }

  this.createGardenTable = function (position){
    return this.createBaseObject(position, images.gardenTable);
  }

  // this.createVerticalWall = function(position){
  //  var verticalWall = this.createBaseObject({width: 10, height: 210}, position);
  //  verticalWall.setAttrs({fill: 'gray'});
  //  return verticalWall;
  // }

  // this.createHorizontalWall = function(position){
  //  var size = {width: 210, height: 10};
  //  var horizontalWall = this.createBaseObject(size, position);
  //  horizontalWall.setAttrs({fill: 'gray'});
  //  return horizontalWall;
  // }

  this.createGardenPlot = function(position){
    return this.createBaseObject(position, images.gardenPlot, 'gardenPlot');
  }


  this.updateAnchor = function (activeAnchor) {
    var group = activeAnchor.getParent();
    var object = group.find('.gardenPlot')[0];
    var bound = group.find('.bound')[0];

    var anchorX = activeAnchor.x();
    var anchorY = activeAnchor.y();
    var anchors = this.getAnchors(group);
    
    // update anchor positions
    switch (activeAnchor.name()) {
      case 'topLeft':
        anchors.topRight.y(anchorY);
        anchors.bottomLeft.x(anchorX);
        break;
      case 'topRight':
        anchors.topLeft.y(anchorY);
        anchors.bottomRight.x(anchorX);
        break;
      case 'bottomRight':
        anchors.bottomLeft.y(anchorY);
        anchors.topRight.x(anchorX); 
        break;
      case 'bottomLeft':
        anchors.bottomRight.y(anchorY);
        anchors.topLeft.x(anchorX); 
        break;
    }

    object.setPosition(anchors.topLeft.getPosition());
    bound.setPosition(anchors.topLeft.getPosition());

    var width = anchors.topRight.x() - anchors.topLeft.x();
    var height = anchors.bottomLeft.y() - anchors.topLeft.y();
    if (width && height) {
      object.setAttrs({ 
        width: width, 
        height: height, 
        offset: {x: 0 , y: 0} 
      });
      bound. setAttrs({ 
        width: width, 
        height: height, 
        offset: {x: 0 , y: 0} 
      });
    }
  }

  this.addAnchors = function (group, options) {
    var _this = this;
    var anchorSize = 10;
    var anchorsCount = 4;

    for (var i = 0; i < anchorsCount; i++){
      var anchor = new Kinetic.Rect({
        x: options[i].x,
        y: options[i].y,
        stroke: '#666',
        fill: '#ddd',
        strokeWidth: 1,
        width: anchorSize,
        height: anchorSize,
        name: options[i].name,
        draggable: true,
        dragOnTop: false,
        visible: false,
        offset: {
          x: anchorSize / 2, 
          y: anchorSize / 2
        },
      });

      anchor.on('dragmove', function(e) {
        _this.updateAnchor(this);
        layer.draw();
      });
      anchor.on('mousedown touchstart', function() {
        group.setDraggable(false);
        this.moveToTop();
      });
      anchor.on('dragend', function() {
        group.setDraggable(true);
        layer.draw();
      });
      
      // add hover styling
      anchor.on('mouseover', function() { document.body.style.cursor = 'pointer'; });
      anchor.on('mouseout', function(){ document.body.style.cursor = 'default'; });

      group.add(anchor);
    }
  }

  // Menu functions
  this.deleteObject = function(){
    var tmpArray = []; // Хранит только не пустые группы выделенных элементов
    var shapes = this.getSelectedShapes();

    for (var i = 0; i < shapes.length; i++){
      shapes[i].destroy();

      if( shapes[i].children.length != 0 ){ 
        tmpArray.push(shapes[i]); 
      }
    }
    
    layer.draw();
    this.setSelectedShapes(tmpArray);
  }

  this.changeObjectTexture = function(src){
    var shapes = this.getSelectedShapes();

    shapes.forEach(function(s){
      if(s.children[0].name() != 'gardenPlot'){ return };
      
      var imageObj = new Image();
      imageObj.onload = function(){
        s.children[0].fillPatternImage(imageObj);
        layer.draw();
      };
      imageObj.src = src;
    });
  }

  this.rotateObject = function(angle){
    var shapes = this.getSelectedShapes();

    for (var i = 0; i < shapes.length; i++){
      shapes[i].children[0].rotate(angle);
      shapes[i].children[1].rotate(angle);
    }
    
    layer.draw();
  }

  this.moveObjectUp = function(){
    var shapes = this.getSelectedShapes();

    for (var i = 0; i < shapes.length; i++){
      shapes[i].moveUp();
    }

    layer.draw();
  }

  this.moveObjectDown = function(){
    var shapes = this.getSelectedShapes();

    for (var i = 0; i < shapes.length; i++){
      shapes[i].moveDown();

      if( shapes[i].children[0].name() == 'gardenPlot'){
        shapes[i].moveToBottom(); 
        shapes[i].moveUp();
      }
      if(shapes[i].getZIndex() == 0){ 
        shapes[i].moveUp(); 
      }
    }

    layer.draw();
  }

  this.saveImage = function(){
    var dataUrl = $('canvas')[0].toDataURL('image/png');

    $.ajax({
      xhr: function(){
        var xhr = new window.XMLHttpRequest();
        var $progressbar = $('#progressbar');
        var percent = 0;
        
        // Прогресс загрузки
        xhr.upload.addEventListener("progress", function(evt){ 
          // Округление до целых
          percent = ~~(evt.loaded/evt.total*100);
          $progressbar.val(percent);
        }, false);

        xhr.addEventListener("load", function(evt){
          $progressbar.val(0);  
        }, false);
        
        return xhr;
      },
      url: '/upload',
      type: 'POST',
      contentType: 'application/json',
      dataType: 'json',
      data:  JSON.strinpngy({data: dataUrl}),
      success: function(url){
        console.log('Image was saved to local drive.');
        var a = document.createElement('a');
        a.download = 'Image.png';
        a.href = url;
        a.click();
          $('#progressDialog').css('height', 0);
      },
      error: function(err){
        console.log('Error while saving image');
      }
    });
  }
} 